import React from "react";

function Homepage() {
  return (
    <div className="main-div">
      <div className="sub-div">
        <div className="sub-sub-div henna">
            <div className="heading">Henna</div>
        </div>
        <div className="sub-sub-div manicure">            <div className="heading">Henna</div></div>
        <div className="sub-sub-div art">            <div className="heading">Henna</div></div>
        <div className="sub-sub-div facepainting">            <div className="heading">Henna</div></div>
      </div>
      <div className="sub-div">
        <div className="sub-sub-div nailart">            <div className="heading">Henna</div></div>
        <div className="sub-sub-div diyapainting"></div>
      </div>
    </div>
  );
}

export default Homepage;
